import React from 'react';
import styled from "styled-components";

const BoxEach = styled.div`
  border: solid 3px white;
  margin: 15px;
  border-radius: 5px;
  display: inline-block;
  background-color: #6c757d;
  width: 350px;
  height: 400px;
`;
const BoxText =styled.div`
  width  : 200px;
  height: 100px;
  background-color: red;

`;

const Text = styled.p`
  font-size: 15px;
  padding-left: 20px;
  height: auto;
  text-align: center;
  background-color: #d27b7b;

`;



const Box = (props) => {
    return (
        <div>
            <BoxEach>Thumbnail
                <Text>{props.Text}</Text>
            </BoxEach>
        </div>
    );
};

export default Box;
